import {
  StyledNav,
  MainContainer,
  LogoContainer,
  Logo,
  LinksContainer,
  LinkBox,
  Links,
  LinkUnderline,
  SocialContainer,
} from "./styles";
import { useState } from "react";

const Nav = () => {
  const [underlineAni, setUnderlineAni] = useState(false);

  const [currHover, setCurrHover] = useState("");

  const hoverAction = (hoverID) => {
    setUnderlineAni(true);
    setCurrHover(hoverID);
  };

  return (
    <MainContainer>
      <LogoContainer>
        <Logo />
      </LogoContainer>
      <LinksContainer>
        <LinkBox
          onMouseEnter={() => hoverAction("projects")}
          onMouseLeave={() => setUnderlineAni(false)}
        >
          <a href="projects-section">
            <Links>Projects</Links>
            <LinkUnderline
              underlineAni={underlineAni}
              currHover={currHover}
              hoverID="projects"
            />
          </a>
        </LinkBox>
        <LinkBox
          onMouseEnter={() => hoverAction("about")}
          onMouseLeave={() => setUnderlineAni(false)}
        >
          <a href="about-section">
            <Links>About</Links>
            <LinkUnderline
              underlineAni={underlineAni}
              currHover={currHover}
              hoverID="about"
            />
          </a>{" "}
        </LinkBox>
        <LinkBox
          onMouseEnter={() => hoverAction("resume")}
          onMouseLeave={() => setUnderlineAni(false)}
        >
          <a href="resume-section">
            <Links>Resume</Links>
            <LinkUnderline
              underlineAni={underlineAni}
              currHover={currHover}
              hoverID="resume"
            />
          </a>{" "}
        </LinkBox>
        <LinkBox
          onMouseEnter={() => hoverAction("contact")}
          onMouseLeave={() => setUnderlineAni(false)}
        >
          <a href="contact-section">
            <Links>Contact</Links>
            <LinkUnderline
              underlineAni={underlineAni}
              currHover={currHover}
              hoverID="contact"
            />
          </a>
        </LinkBox>
      </LinksContainer>
      <SocialContainer></SocialContainer>
    </MainContainer>
  );
};

export default Nav;
